// now repeat the last note to fill in all the blank spaces
// that way we don't have to repeat all the notes in the file and we save a lot of space
for(var key in MIDI.Soundfont.gunshot) { 
	if(MIDI.Soundfont.gunshot[key] == "" && tmp_ptr) {
		MIDI.Soundfont.gunshot[key] = tmp_ptr;
	} else {
		tmp_ptr = MIDI.Soundfont.gunshot[key];   // capture the last valid one
	}
}